import React from 'react';
import {withRouter} from 'react-router-dom';
import './menu-item.style.scss';

const MenuItem = ({props,history,match}) => (
    <div className={`${props.section.size} menu-item`} onClick={() => history.push(`${match.url}${props.section.linkUrl}`)} >
        <div className='background-image'
            style={{
                backgroundImage: `url(${props.section.imageUrl})`
            }}
        />
        <div className='content'>
            <h1 className='title'>{props.section.title.toUpperCase()}</h1>
            <span className='subtitle'>SHOP NOW</span>
        </div>
    </div>
);

export default withRouter(MenuItem);
